var adsbygoogle = window.adsbygoogle || []; 


function blt_social_share(e, href){

	e.preventDefault();

	window.open( href, 'blt-share', "height=450,width=760,resizable=0,toolbar=0,menubar=0,status=0,location=0,scrollbars=0" );
}


function blt_open_login_dialog(href){

	jQuery('#blt-user-modal .modal-dialog').removeClass('registration-complete');

	var modal_dialog = jQuery('#blt-user-modal .modal-dialog');
	modal_dialog.attr('data-active-tab', '');

	switch(href){

		case '#blt-register':
			modal_dialog.attr('data-active-tab', '#blt-register');
			break;

		case '#blt-login':
		default:
			modal_dialog.attr('data-active-tab', '#blt-login');
			break;
	}

	jQuery('#blt-user-modal').modal('show');
}	

function blt_close_login_dialog(){

	jQuery('#blt-user-modal').modal('hide');
}	

