jQuery(window).load( function() {

	var $ = jQuery.noConflict();

	/***************************
	**  GRID MASONRY
	****************************/

		// check if grid is activated
		if($('body[class*="post-layout-grid"]').length && $(window).width() > 992){

			var container = $('#site-content-column > .row');
			var desiredWidth = 0;

			jQuery(window).bind('resizeEnd', function () { 
		
				container.find('.content-post').css('width', '');
				desiredWidth = Math.floor( jQuery('.content-post:nth-child(2)')[0].getBoundingClientRect().width );
				container.find('.content-post').css('width', Math.floor( jQuery('.content-post:nth-child(2)')[0].getBoundingClientRect().width ));
				
				container.masonry({

					gutter: 0,
				  	itemSelector: '.content-post',
				  	columnWidth: desiredWidth

				});

				container.masonry( 'reloadItems' );

			}).trigger('resizeEnd');


		}

	$.noConflict();

});



